package com.example.fptacademysystem.dto;import java.io.Serializable;import java.sql.Date;public class TimetableDTO implements Serializable {    private int courid;    private int semid;    private int stugroid;    private Date startDate;    private int lecturerid;    public TimetableDTO() {        super();    }    public int getLecturerid() {        return lecturerid;    }    public void setLecturerid(int lecturerid) {        this.lecturerid = lecturerid;    }    public int getCourid() {        return courid;    }    public void setCourid(int courid) {        this.courid = courid;    }    public int getSemid() {        return semid;    }    public void setSemid(int semid) {        this.semid = semid;    }    public int getStugroid() {        return stugroid;    }    public void setStugroid(int stugroid) {        this.stugroid = stugroid;    }    public Date getStartDate() {        return startDate;    }    public void setStartDate(Date startDate) {        this.startDate = startDate;    }}